import React from "react"
import Word from "./word"

class Game extends React.Component
{
    constructor(props){
        super(props)
        this.state = {
            word: ""
        }
    }
    onSubmitWord(word){
        word.preventDefault();
        console.log(word.target.value)
        word.target.value = ""
    }
    render(){
     return (
            <Word 
               onSubmitWord = {this.onSubmitWord}
                value = {this.word}
            />
     )
    }
}


export default Game
